[{"location":"95-reference/#reference","page":"Reference","title":"Reference","text":"","category":"section"},{"location":"95-reference/#Contents","page":"Reference","title":"Contents","text":"","category":"section"},{"location":"95-reference/","page":"Reference","title":"Reference","text":"Pages = [\"95-reference.md\"]","category":"page"},{"location":"95-reference/#Index","page":"Reference","title":"Index","text":"","category":"section"},{"location":"95-reference/","page":"Reference","title":"Reference","text":"Pages = [\"95-reference.md\"]","category":"page"},{"location":"95-reference/#SolarPosition.Positioning","page":"Reference","title":"SolarPosition.Positioning","text":"Collection of solar positioning algorithms.\n\n\n\n\n\n","category":"module"},{"location":"95-reference/#SolarPosition.Positioning.Observer","page":"Reference","title":"SolarPosition.Positioning.Observer","text":"Observer{T}\n\nObserver location (degrees, meters). Use Float64 for speed unless you need higher precision.\n\n\n\n\n\n","category":"type"},{"location":"95-reference/#SolarPosition.Positioning.SolarPos","page":"Reference","title":"SolarPosition.Positioning.SolarPos","text":"SolarPos{T}\n\nDescribes a single solar position.\n\n\n\n\n\n","category":"type"},{"location":"95-reference/#SolarPosition.Positioning._solar_position-Union{Tuple{T}, Tuple{Observer{T}, Dates.DateTime, PSA}} where T","page":"Reference","title":"SolarPosition.Positioning._solar_position","text":"_solar_position(\n    obs::Observer{T},\n    dt::DateTime,\n    ::PSA,\n) -> SolarPos{T}\n\nPSA algorithm implementation stub.\n\n\n\n\n\n","category":"method"},{"location":"95-reference/#SolarPosition.Positioning._solar_position-Union{Tuple{T}, Tuple{Observer{T}, TimeZones.ZonedDateTime, SolarPosition.Positioning.NOAA}} where T","page":"Reference","title":"SolarPosition.Positioning._solar_position","text":"_solar_position(\n    obs::Observer{T},\n    dt::ZonedDateTime,\n    ::NOAA,\n) -> SolarPos{T}\n\nNOAA algorithm implementation stub.\n\n\n\n\n\n","category":"method"},{"location":"95-reference/#SolarPosition.Positioning.solar_position","page":"Reference","title":"SolarPosition.Positioning.solar_position","text":"solar_position(obs::Observer, dt::DateTime; alg::SolarAlgorithm=PSA(), kwargs...) -> SolarPos\nsolar_position(obs::Observer, dt::ZonedDateTime; alg::SolarAlgorithm=PSA(), kwargs...) -> SolarPos\nsolar_position(latitude::T, longitude::T, altitude::T, dt::DateTime;\n               alg::SolarAlgorithm=PSA(), kwargs...) -> SolarPos where {T<:AbstractFloat}\nsolar_position(latitude::T, longitude::T, altitude::T, dt::ZonedDateTime;\n               alg::SolarAlgorithm=PSA(), kwargs...) -> SolarPos where {T<:AbstractFloat}\nsolar_position(latitude::AbstractFloat, longitude::AbstractFloat, dt::DateTime;\n               alg::SolarAlgorithm=PSA(), kwargs...) -> SolarPos\nsolar_position(latitude::AbstractFloat, longitude::AbstractFloat, dt::ZonedDateTime;\n               alg::SolarAlgorithm=PSA(), kwargs...) -> SolarPos\nsolar_position(dt::DateTime; latitude::AbstractFloat, longitude::AbstractFloat,\n               altitude::AbstractFloat=0.0, alg::SolarAlgorithm=PSA(), kwargs...) -> SolarPos\nsolar_position(dt::ZonedDateTime; latitude::AbstractFloat, longitude::AbstractFloat,\n               altitude::AbstractFloat=0.0, alg::SolarAlgorithm=PSA(), kwargs...) -> SolarPos\nsolar_position(obs::Observer, dts::AbstractVector{DateTime};\n               alg::SolarAlgorithm=PSA(), kwargs...) -> NamedTuple\nsolar_position(dts::AbstractVector{DateTime}; latitude::AbstractFloat, longitude::AbstractFloat,\n               altitude::AbstractFloat=0.0, alg::SolarAlgorithm=PSA(), kwargs...) -> NamedTuple\nsolar_position(dts::AbstractVector{ZonedDateTime}; latitude::AbstractFloat, longitude::AbstractFloat,\n               altitude::AbstractFloat=0.0, alg::SolarAlgorithm=PSA(), kwargs...) -> NamedTuple\n\nCompute the apparent solar position for a given observer at time dt or vector of times dts.\n\nArguments\n\nobs::Observer : Observer location (latitude, longitude, altitude).\nlatitude, longitude, altitude : Specify observer location directly.\ndt::DateTime or ZonedDateTime : Time at which to compute solar position.\ndts::AbstractVector{DateTime} or AbstractVector{ZonedDateTime} : Vector of times for batch computation.\nalg::SolarAlgorithm : Algorithm to use (default: PSA()).\nkwargs... : Additional keyword arguments forwarded to the algorithm.\n\nReturns\n\nSolarPos : Struct containing solar zenith, azimuth, elevation (for single time).\nNamedTuple : Named tuple with datetime, azimuth, elevation, zenith vectors (for multiple times).\n\nNotes\n\nAll angles are in radians.\n\n\n\n\n\n","category":"function"},{"location":"95-reference/#SolarPosition.Positioning.solar_position!-Tuple{Any, Observer}","page":"Reference","title":"SolarPosition.Positioning.solar_position!","text":"solar_position!(table, obs::Observer; dt_col::Symbol=:datetime, alg::SolarAlgorithm=PSA(), kwargs...)\nsolar_position!(table; latitude::AbstractFloat, longitude::AbstractFloat,\n                altitude::AbstractFloat=0.0, alg::SolarAlgorithm=PSA(), kwargs...)\n\nCompute solar positions for all times in a table and add the results as new columns.\n\nArguments\n\ntable : Table-like object with datetime column (must support Tables.jl interface).\nobs::Observer : Observer location (latitude, longitude, altitude).\nlatitude, longitude, altitude : Specify observer location directly.\ndt_col::Symbol : Name of the datetime column (default: :datetime).\nalg::SolarAlgorithm : Algorithm to use (default: PSA()).\nkwargs... : Additional keyword arguments forwarded to the algorithm.\n\nReturns\n\nModified table with added columns: azimuth, elevation, zenith.\n\nNotes\n\nAll angles are in radians. The input table is modified in-place by adding new columns.\n\n\n\n\n\n","category":"method"},{"location":"90-contributing/#contributing","page":"Contributing guidelines","title":"Contributing guidelines","text":"","category":"section"},{"location":"90-contributing/","page":"Contributing guidelines","title":"Contributing guidelines","text":"First of all, thanks for the interest!","category":"page"},{"location":"90-contributing/","page":"Contributing guidelines","title":"Contributing guidelines","text":"We welcome all kinds of contribution, including, but not limited to code, documentation, examples, configuration, issue creating, etc.","category":"page"},{"location":"90-contributing/","page":"Contributing guidelines","title":"Contributing guidelines","text":"Be polite and respectful.","category":"page"},{"location":"90-contributing/#Bug-reports-and-discussions","page":"Contributing guidelines","title":"Bug reports and discussions","text":"","category":"section"},{"location":"90-contributing/","page":"Contributing guidelines","title":"Contributing guidelines","text":"If you think you found a bug, feel free to open an issue. Focused suggestions and requests can also be opened as issues. Before opening a pull request, start an issue or a discussion on the topic, please.","category":"page"},{"location":"90-contributing/#Working-on-an-issue","page":"Contributing guidelines","title":"Working on an issue","text":"","category":"section"},{"location":"90-contributing/","page":"Contributing guidelines","title":"Contributing guidelines","text":"If you found an issue that interests you, comment on that issue what your plans are. If the solution to the issue is clear, you can immediately create a pull request (see below). Otherwise, say what your proposed solution is and wait for a discussion around it.","category":"page"},{"location":"90-contributing/","page":"Contributing guidelines","title":"Contributing guidelines","text":"tip: Tip\n","category":"page"},{"location":"90-contributing/","page":"Contributing guidelines","title":"Contributing guidelines","text":"Feel free to ping us after a few days if there are no responses.","category":"page"},{"location":"#SolarPosition","page":"SolarPosition","title":"SolarPosition","text":"","category":"section"},{"location":"","page":"SolarPosition","title":"SolarPosition","text":"Welcome!","category":"page"},{"location":"","page":"SolarPosition","title":"SolarPosition","text":"Documentation for SolarPosition.","category":"page"},{"location":"","page":"SolarPosition","title":"SolarPosition","text":"This package provides a collection of solar position algorithms for calculating the position of the sun in the sky based on date, time, and location.","category":"page"}]
